UserSchema.pre('save', function (next) {
	if (!this.isNew) return next();

	if (!validatePresenceOf(this.password) && this.checkValidation()) {
		next(new Error('유효하지 않은 password 필드입니다.'));
	} else {
		next();
	}
});

